import Navbar from './Navbar'
import ChatWidget from './ChatWidget'
import {GoogleApiWrapper } from 'google-maps-react';
import {useEffect, useState} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';
import createReactClass from 'create-react-class'
import {Dropdown, Input} from 'semantic-ui-react'
import 'semantic-ui-css/semantic.min.css'



import royar from './img/royaremlakicon.png'

import axiosInstance from './axios-connection'
import Cards from './Cards'
import MapContainer from './MapContainer'

const DropdownExampleSearchInMenu = () => (
  <Dropdown
    text='Filter Posts'
    icon='filter'
    floating
    labeled
    button
    className='icon'
  >
    <Dropdown.Menu>
      <Input onClick={e => e.stopPropagation()} icon='search' iconPosition='left' className='search' />
      <Dropdown.Divider />
      <Dropdown.Header icon='tags' content='Tag Label' />
      <Dropdown.Menu scrolling>
        {tagOptions.map((option) => (
          <Dropdown.Item key={option.value} {...option} />
        ))}
      </Dropdown.Menu>
    </Dropdown.Menu>
  </Dropdown>
)


const tagOptions = [
  {
    key: 'Important',
    text: 'Important',
    value: 'Important',
    label: { color: 'red', empty: true, circular: true },
  },
  {
    key: 'Announcement',
    text: 'Announcement',
    value: 'Announcement',
    label: { color: 'blue', empty: true, circular: true },
  },
  {
    key: 'Cannot Fix',
    text: 'Cannot Fix',
    value: 'Cannot Fix',
    label: { color: 'black', empty: true, circular: true },
  },
  {
    key: 'News',
    text: 'News',
    value: 'News',
    label: { color: 'purple', empty: true, circular: true },
  },
  {
    key: 'Enhancement',
    text: 'Enhancement',
    value: 'Enhancement',
    label: { color: 'orange', empty: true, circular: true },
  }
]

const containerStyle = {
  position: 'absolute',
  top: '112px',
  right: '0px',
  width: '52.5%',
  height: '85%',
  backgroundColor: 'white',
  boxShadow: '0 4px 8px 0 rgba(0, 0, 0, 0.2), 0 6px 20px 0 rgba(0, 0, 0, 0.19)',
  textAlign: 'center',
  overflow: 'auto',
  }




  var Filters = createReactClass({
    onClick: function(e){
      e.stopPropagation()
    },
    render: function(){
      return <div>

          </div>
    }
  })


export function Search() {


  const [listingData, setListingData] = useState(null);
  const [filters, setFilters] = useState([])

  useEffect( () => {

      axiosInstance
            .get(`listings/query/`, {

            })
            .then((res) => {
                setListingData(res.data)
            })
            .catch((err)=>{
                console.log(err)
            })
  }
)


  return (
    <div>

    <Navbar/>

    <DropdownExampleSearchInMenu/>

    <form className="d-flex" style={{ position: 'relative', top: '9px', width: '100%', left: '1%'}}>
      <input className="form-control me-2" type="search" style={{width: '400px', marginRight: '20px'}} placeholder="Enter an address, neigborhood, city, or ZIP code" aria-label="Search"/>
      <button className="btn btn-success" type="submit" style={{marginRight: '10px'}}>Search</button>


          <button className="btn btn-danger" type="submit" style={{marginRight: '10px'}}>Create Alert</button>
          <a href="https://royaremlak.com/"><img src={royar} alt="royar" style={{width: '45px', height: '40px', position: 'absolute',left: '95%'}}/></a>
    </form>
    <div className="map-and-cards">

    <MapContainer/>

    <div style={containerStyle} className="cards-container">

      <div class="card-columns" style={{gridTemplateColumns: '350px 350px', display: 'grid', rowGap: '50px', columnGap: '18px'}}>

        <Cards listingData={listingData}/>

      </div>

    </div>

    </div>
    <ChatWidget/>
    </div>
  )

}

export default GoogleApiWrapper({
  apiKey: 'AIzaSyBzFqVz_IYQJk4WLohrMjK0z508c7vtB_U'
})(Search);
